async function downloadImages(imageUrls) {
    for(let index=0;index<imageUrls.length;index++) {
        try {
            await download.image({
                url: imageUrls[index],
                dest: `./images/${index}.jpg` 
             });
        } catch(ex) {
            console.error("Failed", imageUrls[index])
        }
        
    }
}

downloadImages(imageUrls);